import { Table, Tag, Space } from "antd";
import { Tabs, Layout } from "antd";

const { TabPane } = Tabs;
const {  Content } = Layout;
function callback(key) {
  console.log(key);
}

const columns = [
  {
    title: "Ma Khach hang",
    dataIndex: "MaKH",
    key: "MaKH",
    render: (text) => <a>{text}</a>,
  },
  {
    title: "Ten khach hang",
    dataIndex: "TenKH",
    key: "TenKH",
  },
  {
    title: "Email khach hang",
    dataIndex: "email",
    key: "email",
  },
  {
    title: "SDT",
    key: "Sdt",
    dataIndex: "Sdt",
  },
];

const data = [
  {
    MaKH: "1",
    TenKH: "Tran Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "2",
    TenKH: "Nguyen Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "3",
    TenKH: "Ho Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "1",
    TenKH: "Tran Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "2",
    TenKH: "Nguyen Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "3",
    TenKH: "Ho Uy",
    email: "asdas",
    Sdt: "123213",
  },
];

function DsHoaDon() {
  return (
    <div>
      <Layout>
        <Content>
            <Tabs onChange={callback} type="card">
              <TabPane tab="Tất cả" key="1">
                Tất cả
              </TabPane>
              <TabPane tab="Chờ xác nhận" key="2">
                Chờ xác nhận
              </TabPane>
              <TabPane tab="Tab 3" key="3">
                Đang xử lý
              </TabPane>
              <TabPane tab="Tab 4" key="4">
                Đang vận chuyển
              </TabPane>
              <TabPane tab="Tab 5" key="5">
                Đã giao hàng
              </TabPane>
              <TabPane tab="Tab 6" key="6">
                Đã hủy
              </TabPane>
            </Tabs>
            <br/>
            <Table columns={columns} dataSource={data} />
        </Content>
      </Layout>
    </div>
  );
}

export default DsHoaDon;
